    //\u73B0\u5728\u6211\u4EEC\u8BA1\u7B97copyFd\u7684\u504F\u79FB\u91CF
    cout << "copyFd = " << copyFd << "\u504F\u79FB\u91CF\uFF1A" << lseek(copyFd, 0, SEEK_CUR) << endl;
